import React, {Component} from 'react';

import Axios from '../../axio-cart';

class Cart extends Component {
    state = {
        cart: [],
        isLoaded: false
    }

    componentDidMount() {
        Axios.get('/cart/5f63e617b29b17b8d1f854a7/find-cart-by-id')
            .then(res => console.log(res.data))
    }

    render() {
        return (
            <div>
                This is the cart
            </div>
        )
    }
}

export default Cart
